import React from 'react';
import Postlist from './Postlist';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './App.css';


const HOME = () => (
  <div>
    <h2>HOME</h2>
  </div>
)

const Products = () => (
  <div>
    <h2>Products</h2>
  </div>
)

function App() {
  return (
    <div className="App">
      <Postlist />
      <Router>
        <Route path="/"  component={Postlist} />
        <Route path="/products" component={Products}/>
      </Router>
    </div>
  );
}

export default App;
